import React, {useState} from 'react'
import { NavLink,useNavigate  } from 'react-router-dom';
import { LogOut, reset } from "../features/authSlice";
import { useDispatch, useSelector } from "react-redux";
import logo from '../images/logo-dash.svg';
import { HomeIcon,TickSquareIcon, CalendarIcon, DocumentIcon, UsersIcon,AddUserIcon, LocationIcon, ScanIcon, RaportIcon, ActivityIcon, LogoutIcon } from '../common/icons/icons';
const Navbar = () => {
    const dispatch = useDispatch();
  const navigate = useNavigate();
  const { user } = useSelector((state) => state.auth);

    const logout = () => {
        dispatch(LogOut());
        dispatch(reset());
        navigate("/");
    };

    const [showMenu, setShowMenu] = useState(false);

    function handleArrowClick() {
      setShowMenu(!showMenu);
    }
  
    function handleSidebarClick() {
      setShowMenu(false);
    }
  
  

    return (
        <div>
      <div className={`sidebar ${showMenu ? "showMenu" : ""}`}>
      <div className="arrow" onClick={handleArrowClick}>
        <i className="fas fa-arrow-left"></i>
      </div>
      <ul>
        <li>Menu Item 1</li>
        <li>Menu Item 2</li>
        <li>Menu Item 3</li>
      </ul>
      <div className="sidebar-btn" onClick={handleSidebarClick}>
        <i className="bx bx-menu"></i>
      </div>
    </div>
</div>

                
      
    )


}

export default Navbar
